/*jshint esversion: 6, asi: true, laxbreak: true*/
pc.script.createLoadingScreen(function (app) {
    const createCfLoader = () => {
        const imageBackground = 
        'data:image/png;base64,';
        const imageLabel = 
        'data:image/png;base64,';
        const imagePic = "";
        //'data:image/png;base64,';
        const imageProgressBoard = "";
         //'data:image/png;base64,';
        const imageBot = "";
        //'data:image/png;base64,';

        const styles = {
            cfLoader: `position: fixed; background-image: url('${imageBackground}'); background-size: cover; background-position: center; height: 100%; width: 100%;`,
            cfLoaderContainer: `width: 90%; margin: 2vh auto auto auto;`,
            cfLoaderLabel: `text-align: center; width: 68%; max-width: 230px; position: fixed; left: 50%; transform: translateX(-50%); top: 42%;`,
            cfLoaderImage: `width:100%; height: calc(width);`,
            cfLoaderProgressBar: `position: fixed; top: 53%; left: 50.5%; transform: translateX(-50%); width: ${window.innerWidth * 0.56}px; height: ${window.innerWidth * 0.02}px ;`,
            cfLoaderProgressBoard: `position: absolute; width:100%; height:100%; background-image: url('${imageProgressBoard}'); background-size: 100% 100%;`,
            cfLoaderProgressLine: `transform: translate(0px, 0px); position: absolute; max-width: calc(100% - 6px); height: calc(100% - 6px);
                background:linear-gradient(90deg, #ff003b 0%, #ff003b 10%, #8536ab 90%, #8536ab 100%); border-radius:10px; border: solid 0px white;
                background-size:100% 100%; width: 10%;`,
            cfLoaderPic: "position: fixed; top: 62%; left: 50%; transform: translateX(-50%); width:60%;",
            cfLoaderImageLogo: "width: 100%",
            cfLoaderBot: "position: fixed; top: 91%; left: 50%; transform: translateX(-50%); width:56%;",
            cfLoaderBotImage: "width: 100%",
        };

        const html = `
<div id="cf-loader" style="${styles.cfLoader}">
<div id="cf-loader_container" style="${styles.cfLoaderContainer}">
<div id="cf-loader_label" style="${styles.cfLoaderLabel}">
<img src="${imageLabel}" style="${styles.cfLoaderImage}"/>
</div>
<div id="cf-loader_progress-bar-wrapper" style="${styles.cfLoaderProgressBar}">
<div id="cf-loader_progress-board" style="${styles.cfLoaderProgressBoard}">
</div>
<div id="cf-loader_progress-line" style="${styles.cfLoaderProgressLine}">
</div>
</div>
<div id="cf-loader_pic" style="${styles.cfLoaderPic}">
<img src="${imagePic}" style="${styles.cfLoaderImageLogo}"/>
</div>
<div id="cf-loader_bot" style="${styles.cfLoaderBot}">
<img src="${imageBot}" style="${styles.cfLoaderBotImage}"/>
</div>
</div>
</div>
`;

        const domElement = document.createElement('div');
        domElement.innerHTML = html;

        const progressLine = domElement.querySelector('#cf-loader_progress-line')
        const progress = 0;
        const changeProgress = (progress) => {
            progress = progress * 100;
            if (progress > 100) progress = 100;
            if (progress < 10) progress = 10;
            progressLine.style.width = `${progress}%`;
        }

        const remove = () => {
            domElement.remove();
        }

        return {
            domElement,
            changeProgress,
            remove,
        };
    };

    const cfLoader = createCfLoader();
    document.body.appendChild(cfLoader.domElement);
    app.on('preload:end', function () { app.off('preload:progress'); });
    app.on('preload:progress', cfLoader.changeProgress);
    app.on('start', cfLoader.remove);
});